[HoesNToes] Tori Black (Charmed Indeed / 08.10.2013)

In this Cinderella scene, Prince Charming discovers a shoe on the staircase, happy to oblige, Tori tries on the shoe at his request and treats him to a show of her pretty little tootsies . Bending to kiss them is a bit more than Mr. Charming can take and soon he's licking and sucking away, which of course leads to licking and sucking of other things. It's a rollicking good time and our prince - who's chivalrous to the end - shows his appreciation by showering Tori's feet with affection.

